using System;
using System.IO;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using UnityEngine;

namespace GInfo {
    public class GInfo_GUI : MonoBehaviour {
        public bool ShowMenu = false;
        public bool ShowHelp = false;
        public bool ShowVip = false;
        public bool ShowRules = false;

        public Texture2D ButtonOFF;
        public Texture2D ButtonHover;
        public Texture2D ButtonON;
        public Texture2D HButtonOFF;
        public Texture2D HButtonHover;
        public Texture2D HButtonON;
        public Texture2D RButtonOFF;
        public Texture2D RButtonHover;
        public Texture2D RButtonON;
        public Texture2D VButtonOFF;
        public Texture2D VButtonHover;
        public Texture2D VButtonON;
        public Texture2D HelpInfo;
        public Texture2D VipInfo;
        public Texture2D RulesInfo;
        public void Start() {
            byte[] BButtonOFF = System.Convert.FromBase64String("");
            byte[] BButtonHover = System.Convert.FromBase64String("");
            byte[] BButtonON = System.Convert.FromBase64String("");
            byte[] HBButtonOFF = System.Convert.FromBase64String("");
            byte[] HBButtonHover = System.Convert.FromBase64String("");
            byte[] HBButtonON = System.Convert.FromBase64String("");
            byte[] VBButtonOFF = System.Convert.FromBase64String("");
            byte[] VBButtonHover = System.Convert.FromBase64String("");
            byte[] VBButtonON = System.Convert.FromBase64String("");
            byte[] RBButtonOFF = System.Convert.FromBase64String("");
            byte[] RBButtonHover = System.Convert.FromBase64String("");
            byte[] RBButtonON = System.Convert.FromBase64String("");
            byte[] BHelpInfo = System.Convert.FromBase64String("");
            byte[] BVipInfo = System.Convert.FromBase64String("");
            byte[] BRulesInfo = System.Convert.FromBase64String("");


            ButtonOFF = new Texture2D(60, 16, TextureFormat.RGB24, false);
            ButtonHover = new Texture2D(60, 16, TextureFormat.RGB24, false);
            ButtonON = new Texture2D(60, 16, TextureFormat.RGB24, false);
            HButtonOFF = new Texture2D(60, 16, TextureFormat.RGB24, false);
            HButtonHover = new Texture2D(60, 16, TextureFormat.RGB24, false);
            HButtonON = new Texture2D(60, 16, TextureFormat.RGB24, false);
            VButtonOFF = new Texture2D(60, 16, TextureFormat.RGB24, false);
            VButtonHover = new Texture2D(60, 16, TextureFormat.RGB24, false);
            VButtonON = new Texture2D(60, 16, TextureFormat.RGB24, false);
            RButtonOFF = new Texture2D(60, 16, TextureFormat.RGB24, false);
            RButtonHover = new Texture2D(60, 16, TextureFormat.RGB24, false);
            RButtonON = new Texture2D(60, 16, TextureFormat.RGB24, false);
            HelpInfo = new Texture2D(700, 600, TextureFormat.RGB24, false);
            VipInfo = new Texture2D(700, 600, TextureFormat.RGB24, false);
            RulesInfo = new Texture2D(700, 600, TextureFormat.RGB24, false);



            ButtonOFF.LoadImage(BButtonOFF);
            ButtonHover.LoadImage(BButtonHover);
            ButtonON.LoadImage(BButtonON);
            HButtonOFF.LoadImage(HBButtonOFF);
            HButtonHover.LoadImage(HBButtonHover);
            HButtonON.LoadImage(HBButtonON);
            VButtonOFF.LoadImage(VBButtonOFF);
            VButtonHover.LoadImage(VBButtonHover);
            VButtonON.LoadImage(VBButtonON);
            RButtonOFF.LoadImage(RBButtonOFF);
            RButtonHover.LoadImage(RBButtonHover);
            RButtonON.LoadImage(RBButtonON);
            HelpInfo.LoadImage(BHelpInfo);
            VipInfo.LoadImage(BVipInfo);
            RulesInfo.LoadImage(BRulesInfo);

            Debug.Log("Start Server Info Meniu By Gintaras");
        }
        public void OnGUI() {
            int w = Screen.width, h = Screen.height;
            Rect Infopos = new Rect(0, 20, 60, 16);
            if (Infopos.Contains(Event.current.mousePosition)) {
                GUI.DrawTexture(Infopos, ButtonHover, ScaleMode.StretchToFill);
                if (Event.current.type == EventType.MouseDown || Input.GetButtonDown("Fire1")) {
                    if (ShowMenu) {
                        ShowMenu = false;
                    } else {
                        ShowMenu = true;
                    }
                }
            } else {
                if (ShowMenu) {
                    GUI.DrawTexture(Infopos, ButtonON, ScaleMode.StretchToFill);
                } else {
                    GUI.DrawTexture(Infopos, ButtonOFF, ScaleMode.StretchToFill);
                }
            }
            if(ShowMenu) {
                Rect Helppos = new Rect(0, 40, 60, 16);
                if (Helppos.Contains(Event.current.mousePosition)) {
                    GUI.DrawTexture(Helppos, HButtonHover, ScaleMode.StretchToFill);
                    if (Event.current.type == EventType.MouseDown || Input.GetButtonDown("Fire1")) {
                        if (ShowHelp) {
                            ShowHelp = false;
                        } else {
                            ShowHelp = true;
                        }
                    }
                } else {
                    if (ShowHelp) {
                        GUI.DrawTexture(Helppos, HButtonON, ScaleMode.StretchToFill);
                    } else {
                        GUI.DrawTexture(Helppos, HButtonOFF, ScaleMode.StretchToFill);
                    }
                }
                Rect Vippos = new Rect(0, 60, 60, 16);
                if (Vippos.Contains(Event.current.mousePosition)) {
                    GUI.DrawTexture(Vippos, VButtonHover, ScaleMode.StretchToFill);
                    if (Event.current.type == EventType.MouseDown || Input.GetButtonDown("Fire1")) {
                        if (ShowVip) {
                            ShowVip = false;
                        } else {
                            ShowVip = true;
                        }
                    }
                } else {
                    if (ShowVip) {
                        GUI.DrawTexture(Vippos, VButtonON, ScaleMode.StretchToFill);
                    } else {
                        GUI.DrawTexture(Vippos, VButtonOFF, ScaleMode.StretchToFill);
                    }
                }
                Rect Rulespos = new Rect(0, 80, 60, 16);
                if (Rulespos.Contains(Event.current.mousePosition)) {
                    GUI.DrawTexture(Rulespos, RButtonHover, ScaleMode.StretchToFill);
                    if (Event.current.type == EventType.MouseDown || Input.GetButtonDown("Fire1")) {
                        if (ShowRules) {
                            ShowRules = false;
                        } else {
                            ShowRules = true;
                        }
                    }
                } else {
                    if (ShowRules) {
                        GUI.DrawTexture(Rulespos, RButtonON, ScaleMode.StretchToFill);
                    } else {
                        GUI.DrawTexture(Rulespos, RButtonOFF, ScaleMode.StretchToFill);
                    }
                }
            }
            if (ShowHelp) {
                GUI.DrawTexture(new Rect(w / 2 - 350, h / 2 - 300, 700, 600), HelpInfo);
            }
            if (ShowVip) {
                GUI.DrawTexture(new Rect(w / 2 - 350, h / 2 - 300, 700, 600), VipInfo);
            }
            if (ShowRules) {
                GUI.DrawTexture(new Rect(w / 2 - 350, h / 2 - 300, 700, 600), RulesInfo);
            }

        }
    }
}